import React from "react";

const MessageActions = (props) => {
  const icons = props.iconsNames.map((iconName) => (
    <em className={`action ${iconName} fa-lg`}></em>
  ));

  return (
    <div className="message-actions">
      <div className="actions">{icons}</div>
    </div>
  );
};

export default MessageActions;
